aKeyboardShortc	db '$Keyboard Shortcuts:|F1:    Open Help Screen|Esc:   Display Main ' ; ...
		db 'Menu|Tab:   Display Auto-map|Space: Hide all info screens|S: Open'
		db ' Speedbook|B: Open Magicbook|I: Open Inventory screen|C: Open Cha'
		db 'racter screen|Q: Open Quest log|F: Reduce screen brightness|G: In'
		db 'crease screen brightness|Z: Zoom Game Screen|+ / -: Zoom Automap|'
		db '1 - 8: Use Belt item|F5, F6, F7, F8:     Set hot key for skill or'
		db ' spell|Shift + Left Click: Attack without moving||$Movement:|If y'
		db 'ou hold the mouse button down while moving, the character will co'
		db 'ntinue to move in that direction.||$Combat:|Holding down the shif'
		db 't key and then left-clicking allows the character to attack witho'
		db 'ut moving.||$Auto-map:|To access the auto-map, click the ',27h,'MAP',27h
		db ' button on the Information Bar or press ',27h,'TAB',27h,' on the keyboa'
		db 'rd. Zooming in and out of the map is done with the + and - keys. '
		db 'Scrolling the map uses the arrow keys.||$Picking up Objects:|Usea'
		db 'ble items that are small in size, such as potions or scrolls, are'
		db ' automatically placed in your ',27h,'belt',27h,' located at the top of '
		db 'the Interface bar . When an item is placed in the belt, a small n'
		db 'umber appears in that box. Items may be used by either pressing t'
		db 'he corresponding number or right-clicking on the item.||$Gold|You'
		db ' can select a specific amount of gold to drop by right clicking o'
		db 'n a pile of gold in your inventory.||$Skills & Spells:|You can ac'
		db 'cess your list of skills and spells by left-clicking on the ',27h,'M'
		db 'agics',27h,' button in the interface bar. Memorized spells and those'
		db ' available through staffs are listed here. Left-clicking on the s'
		db 'pell you wish to cast will ready the spell. A readied spell may b'
		db 'e cast by simply right-clicking in the play area.||$Using the Spe'
		db 'edbook for Spells|Left-clicking on the ',27h,'readied spell',27h,' butt'
		db 'on will open the ',27h,'Speedbook',27h,' which allows you to select a s'
		db 'kill or spell for immediate use.  To use a readied skill or spell'
		db ', simply right-click in the main play area.||$Setting Spell Hotke'
		db 'ys|You can assign up to four Hot Keys for skills, spells or scrol'
		db 'ls.  Start by opening the ',27h,'speedbook',27h,' as described in the s'
		db 'ection above. Press the F5, F6, F7 or F8 keys after highlighting '
		db 'the spell you wish to assign.||$Magic Books|Reading more than one'
		db ' book increases your knowledge of that spell, allowing you to cas'
		db 't the spell more effectively.|&',0
